import React from 'react';

const Home = () => {
  return (
    <section className="bg-gray-100 py-8">
      <div className="container mx-auto px-4">
        <h2 className="text-2xl font-bold mb-4">Mes Projets</h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          <div className="bg-white rounded-lg p-4 shadow">
            <h3 className="text-xl font-bold mb-2">Projet 1</h3>
            <p className="text-gray-700">Description du projet 1...</p>
          </div>
          <div className="bg-white rounded-lg p-4 shadow">
            <h3 className="text-xl font-bold mb-2">Projet 2</h3>
            <p className="text-gray-700">Description du projet 2...</p>
          </div>
          <div className="bg-white rounded-lg p-4 shadow">
            <h3 className="text-xl font-bold mb-2">Projet 3</h3>
            <p className="text-gray-700">Description du projet 3...</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Home;
